import React from "react";
import {
  LayoutDashboard,
  MessageSquare,
  CalendarDays,
  FileUp,
  Workflow,
  ClipboardList,
  LogOut,
  UsersRound,
  X,
  ArrowRight,
} from "lucide-react";
import { useNavigate, useLocation } from "react-router-dom";
import { motion, AnimatePresence } from "framer-motion";

interface SidebarProps {
  isOpen: boolean;
  onClose: () => void;
}

const Sidebar: React.FC<SidebarProps> = ({ isOpen, onClose }) => {
  const navigate = useNavigate();
  const location = useLocation();

  const navItems = [
    { label: "Overview", icon: LayoutDashboard, path: "/dashboard", id: "01" },
    { label: "Dialogue", icon: MessageSquare, path: "/chat", id: "02" },
    { label: "Directives", icon: ClipboardList, path: "/tasks", id: "03" },
    { label: "Collective", icon: UsersRound, path: "/meetings", id: "04" },
    { label: "Schedule", icon: CalendarDays, path: "/calendar", id: "05" },
    { label: "Resources", icon: FileUp, path: "/files", id: "06" },
    { label: "Processes", icon: Workflow, path: "/workflows", id: "07" },
  ];

  return (
    <>
      <AnimatePresence>
        {isOpen && (
          <motion.div
            initial={{ opacity: 0 }}
            animate={{ opacity: 1 }}
            exit={{ opacity: 0 }}
            className="fixed inset-0 bg-black/60 z-40 lg:hidden"
            onClick={onClose}
          />
        )}
      </AnimatePresence>

      <aside
        className={`
          fixed top-0 left-0 z-50 h-screen w-64 bg-white border-r border-[#111111]
          transform transition-transform duration-300 ease-in-out
          ${isOpen ? "translate-x-0" : "-translate-x-full"}
          lg:translate-x-0 flex flex-col
        `}
      >
        {/* Brand Section */}
        <div
          className="p-8 pb-12 swiss-border-b cursor-pointer group"
          onClick={() => {
            navigate("/dashboard");
            onClose();
          }}
        >
          <div className="flex flex-col gap-4">
            <div className="w-10 h-10 border-2 border-[#111111] flex items-center justify-center p-2 group-hover:bg-[#111111] transition-colors">
              <img src="/logo1.png" alt="Logo" className="w-full h-full group-hover:invert transition-all" />
            </div>
            <div>
              <h1 className="text-2xl font-black tracking-tighter uppercase text-[#111111]">Collabryta</h1>
              <span className="swiss-label text-[#ff3e00]">Vol. 01 / 2025</span>
            </div>
          </div>
        </div>

        {/* Navigation */}
        <nav className="flex-1 py-8 overflow-y-auto custom-scrollbar">
          <div className="px-8 mb-6">
            <span className="swiss-label py-1 border-b-2 border-[#111111]">Index</span>
          </div>
          <div className="space-y-0.5">
            {navItems.map(({ label, icon: Icon, path, id }) => {
              const active = location.pathname === path;
              return (
                <button
                  key={path}
                  onClick={() => {
                    navigate(path);
                    onClose();
                  }}
                  className={`w-full flex items-center justify-between px-8 py-3.5 group transition-colors
                    ${active
                      ? "bg-[#111111] text-white"
                      : "text-[#111111] hover:bg-zinc-100"
                    }`}
                >
                  <div className="flex items-center gap-4">
                    <span className={`text-[10px] font-mono font-bold ${active ? "text-[#ff3e00]" : "text-zinc-400"}`}>{id}</span>
                    <span className="text-xs font-bold uppercase tracking-widest">{label}</span>
                  </div>
                  <ArrowRight size={14} className={`opacity-0 group-hover:opacity-100 transition-opacity ${active ? "text-[#ff3e00]" : ""}`} />
                </button>
              );
            })}
          </div>
        </nav>

        {/* Action Area */}
        <div className="p-8 swiss-border-t">
          <button
            onClick={() => navigate("/login")}
            className="w-full swiss-button"
          >
            Exit System
          </button>
          <div className="mt-6 flex justify-between items-center text-[8px] font-mono font-bold text-zinc-400 uppercase tracking-widest">
            <span>System Rev 2.0</span>
            <span className="text-[#ff3e00]">Active</span>
          </div>
        </div>
      </aside>
    </>
  );
};

export default Sidebar;
